import React, { useState } from 'react'

const TodoList=()=>{

    const[num, setNum]= useState(0);

    const incNum=()=>{
        setNum(num+1)
    }
    const dec=()=>{
        if(num>0)
        setNum(num-1)
    }
    return(
        <>
        <div className='main_div'>
            <div className='center_div' >
            <h1>{num}</h1>
            <div className='btn'>
            <button onClick={incNum}>Increm</button>
            <button onClick={dec}>decrem</button>
            </div>
            </div>
            </div>
            

        </>
    )
}
export default TodoList;
